import React from "react";
import CodingPage from "../CodingPage/CodingPage";
import ContactPage from "../ContactPage/ContactPage";
import ComicsPage from "../ComicsPage/ComicsPage";
import profile from "../images/profile-photo.jpg";

const LandingPage = () => {
  return (
    <div className="content">
      {/* Welcome Container */}
        <h1 className="welcome-blurb">welcome to mattstyles.com</h1>
        <h2 className="welcome-blurb2">I write code and comics.</h2>

        {/* Profile Container */}
        <div className="profile">
        <p className="profile-blurb">Thanks for visiting my site! I'm a Knoxville-based creative with skills in both web development and creative writing. 
          As a certified front-end and back-end developer, I'm passionate about building and maintaining clean, user and collaborator-friendly websites. I'm a trained screenwriter collaborating with artists to bring my stories to life. You can find out more about my graphic novels in the comics section.  </p> 
          <img 
            src={profile} 
            alt="Profile" 
            className="profile-photo"
          />
      </div>

      {/* Coding Section */}
      <CodingPage/>

      {/* Comics Section */}
      <ComicsPage/>

      {/* Contact Section */}
      <ContactPage/>
    </div>
  );
};

export default LandingPage;
